import React from 'react';
import '../App.css';
function Nav(){ 
    return(   
    <center>
        <ul class="nav nav-fill border">
        <li class="nav-item">
          <a class="nav-link active">Top Filmes</a>
        </li>
        <li class="nav-item">
          <a class="nav-link">Buscar</a>
        </li>
        <li class="nav-item">
          <a class="nav-link">Login</a>
        </li>
        </ul>
    </center>
)}

export default Nav
